INSERT INTO urls VALUES (5, 'Media', 'Riding The World''s Best Downhill Bike Park', 'You''ve seen the articles, watched events like Crankworx and Red Bull Rampage, and even scoured Craigslist until 4 AM looking for a bike, but now you''re ready to have a go at downhill mountain biking. We''ll walk you through how to do it like a champ so you can walk away and live to ride another day. Of all lift served mountain bike parks in the world, Whistler is known as the world''s greatest with more than 75 trails and over 50 miles of lift served gravity only routes.', '2014-10-08 15:40:31.394031', '2014-10-08 15:40:31.394031', 'DOWN HILL MOUNTAIN BIKE, CANADA, WHISTLER, HOW TO, ADVENTURES, BIKE, IndefinitelyWild', 5, 'gizmodo.com', 'http://indefinitelywild.gizmodo.com/riding-the-worlds-best-downhill-bike-park-1632929952', true, true, true);
