INSERT INTO urls VALUES (12, 'Media', 'I Heart My National Park: Joshua Tree – Intelligent Travel', 'Jeff Ohlfs began his love affair with Joshua Tree National Park a quarter of a century ago. The chief ranger of the park, Ohlfs has seen more of Joshua Tree than any other person posted there. "I remember believing I could never work in a desert park," says the national park service veteran. "Now, two decades later, I cannot pull myself away from it. For me, it is home." Here''s his insider''s guide to one of the premier jewels of the Southern California desert.', '2014-10-10 04:06:31.645859', '2014-10-10 04:06:31.645859', '', 12, 'nationalgeographic.com', 'http://intelligenttravel.nationalgeographic.com/2014/10/03/i-heart-my-national-park-joshua-tree/', true, true, true);
