INSERT INTO urls VALUES (22, 'Media', 'Descend Into the Surreal World of Tourist-Friendly Caves | WIRED', 'Caves are intrinsically mysterious, beautiful places, which of course makes them great places to explore. But they tend to be dark, deep and occasionally dangerous, which means they need various safety features and amenities to be visitor-friendly. The results are sometimes garish, occasionally comical, and often spectacular in their own way. Austin Irving became interested…', '2014-10-29 14:39:53.708013', '2014-10-29 14:39:53.708013', 'Wired.com, Wired News, Wired Blogs, tech news, technology, gadgets, gizmos, reviews, tech, science, politics, culture, electronics', 22, 'wired.com', 'http://www.wired.com/2014/10/austin-irving-show-caves', true, true, true);
INSERT INTO urls VALUES (23, 'Media', 'Best comedy clubs in Los Angeles - CNN.com', 'As entertainment capital of the world, Los Angeles draws some of the best comic talent on the planet. Here''s where to see it live.', '2014-10-30 01:00:19.652326', '2014-10-30 01:00:19.652326', '', 23, 'cnn.com', 'http://www.cnn.com/2014/10/27/travel/la-comedy-clubs/', true, true, true);
INSERT INTO urls VALUES (24, 'Media', 'Guido''s of Chicago in Scottsdale Stays True to the Simple Pleasure of Eating | Phoenix New Times', 'I often find myself wondering when the seemingly insatiable desire for culinary reinterpretation and deconstruction will finally have reached its endgame, when food has been reinvented and disassembl... Page 1', '2014-11-14 20:03:08.293747', '2014-11-14 20:03:08.293747', ',', 24, 'phoenixnewtimes.com', 'http://www.phoenixnewtimes.com/2014-05-29/restaurants/guido-s-of-chicago-in-scottsdale-stays-true-to-the-simple-pleasure-of-eating/', true, true, true);
INSERT INTO urls VALUES (25, 'Media', 'T+L''s Definitive Guide to Portland, Oregon - Articles | Travel + Leisure', 'With forward-thinking chefs, green urban spaces, and a laid-back sensibility, Portland, Oregon, is the perfect weekend getaway.', '2014-11-14 20:24:32.950749', '2014-11-14 20:24:32.950749', 'T+L''s Definitive Guide to Portland, Oregon articles, T+L''s Definitive Guide to Portland, Oregon stories, T+L''s Definitive Guide to Portland, Oregon facts', 25, 'travelandleisure.com', 'http://www.travelandleisure.com/articles/tls-definitive-guide-to-portland-oregon', true, true, true);
INSERT INTO urls VALUES (26, 'Media', 'Cedros Design District - Ranch & Coast Magazine', 'Originally home to a defense contractor who in the 1950s built Quonset huts along a two-and-a-half mile block, Cedros Design District has evolved into an eclectic community of boutiques, shops, cafes, salons, day spas, galleries, a winery, a craft brewery, and a live music venue.', '2014-11-14 20:33:13.319761', '2014-11-14 20:33:13.319761', '', 26, 'ranchandcoast.com', 'http://ranchandcoast.com/2014/05/27/cedros-design-district/', true, true, true);
